def fastaanalyze(text,cutoff):
    global results
    if text != "":
        if text[0:6] != "HEADER":
            seqlist = []
            fastafile = ""
            if ">" in text:
                for chain in text.split(">"):
                    if chain != "":
                        splittext = chain.splitlines()
                        title = splittext[0]
                        seq = "".join(splittext[1:])
                        (boldbsa,bsaseq,boldseq,newseq,numbseq) = sequenceanalyze(seq,cutoff)
                        if sorted(set(newseq)) != ["X"] and "U" not in newseq:
                            fastafile += ">" + title + "\n" + bsaseq + "\n" + newseq + "\n"
            else:
                title = ""
                splittext = text.splitlines()
                seq = "".join(splittext)
                (boldbsa,bsaseq,boldseq,newseq,numbseq) = sequenceanalyze(text,cutoff)
                if sorted(set(newseq)) != ["X"] and "U" not in newseq:
                    fastafile = ">" + title + "\n" + bsaseq + "\n" + newseq + "\n"
            results = ["success",fastafile]
        else:
            results = ["error","File Type Error: Please choose correct file type."]
    else:
        results = ["error","Info Error: No file selected. Please choose file."]

